import React from 'react';
import "./User.css";
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Button, Container } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  }));

const User = props => {
    const classes = useStyles();
    const usersData = props.items;
    let count = 1;
    const artistData = usersData.map((artist) =>
    <div className={classes.root}>
    <Grid container spacing={3}>
      <Grid item xs={3}>
          <div></div>
      </Grid>
      <Grid item xs={6}>
      <a href={artist.external_urls.spotify} target="_blank" rel="noopener noreferrer">
                        <img src={artist.images[0].url} alt="artist" className=""/>
                    </a>
      </Grid>
      <Grid item xs={3}>
        <Typography variant="h3">#{count++}</Typography>
      </Grid>
      <Grid item xs={6}>
        <Typography variant="h2" className="artistName">{artist.name}</Typography>
      </Grid>
    </Grid>
  </div>
    ) 
    return (
        <div className="section">
             <button onClick={() => props.handleClick("artists")}> click for artists</button>
            <h1>Your Top 10 Favorite Artist</h1>
            {artistData}
        </div>
    )
}
export default User;
